                <p>VÃ¥rt mÃ¥l Ã¤r att undersÃ¶ka likheter och skillnader i vad de olika Explainable AI-algoritmerna pÃ¥visar Ã¤r de viktigaste aspekterna vid klassificering fÃ¶r en AI-modell och jÃ¤mfÃ¶ra detta med vad mÃ¤nniskor prioriterar nÃ¤r de identifierar objekt. PÃ¥ detta sÃ¤tt kan vi hitta eventuella mÃ¶nster som kan antyda vilka Explainable AI-metoder som Ã¤r mest lika mÃ¤nskligt resonerande och utifrÃ¥n detta undersÃ¶ka om just dessa metoder Ã¤r mer givande fÃ¶r att Ã¶ka mÃ¤nniskors fÃ¶rstÃ¥else fÃ¶r en AI-modell.</p>
